import React from "react";
import ReactDOM from "react-dom";
import Card from "./App";
import Sdata from "./Div";
//simport Sdata from "./Div";
//import "./index.css";



const newarr=Sdata.map(function arr(vala){
  return (
   <Card imgsrc={vala.imgscr}
         title={vala.title}
         sname={vala.sname}
         link={vala.link}
  //yesss={vala[value].oo}

/>
  )}
)





//let val = Sdata.map(value);
ReactDOM.render(
  <>
  
  {newarr} 
 

  

        
</>,
document.getElementById("root"));
